const styles = {
  margin: "10px",
  alignSelf: "right",
  background: "grey",
  borderRadius: "50%",
}
function importImage(imagePath) {
  const image = require(imagePath).default;
  return image;
}

function CircularIcon(props) {
  return (
    <div style = {styles.buttonIconStyles}>
      <img src = {require('"./../images/icons/" + props.type + "Icon.png"').default} style = {styles.imageStyles}></img>
      <p>I am a {props.type} icon!</p>
    </div>
  )
}

export default CircularIcon;
